		function tree(data) {    
			if (typeof(data) == 'object') {        
				var ul = $('<ul>');
				for (var i in data) {            
					ul.append($('<li>').text(i).append(tree(data[i])));         
				}        
				return ul;
			} else {       
				var textNode = document.createTextNode(' => ' + data);
				return textNode;
			}
		}

		function tree2(data) {    
			if (typeof(data) == 'object') {        
				var ul = $('<ul>');
				for (var i in data) {            
					ul.append($('<li>').text(i).append(tree(data[i])));         
				}        
				return ul;
			} else {       
				var textNode = document.createTextNode(' => ' + data);
				return textNode;
			}
		}

		function onLoad(data) {
			$(document.body).append(tree2(JsonData));
			//console.log(JSON.stringify(JsonData, null, 0)); //here my json array
		}
